  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\n// Looking for ways to speed up your queries, or scale easily with your serverless or edge functions?\n// Try Prisma Accelerate: https://pris.ly/cli/accelerate-init\n\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../src/generated/prisma\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// ============================================================================\n// AUTH.JS MODELS (Required for NextAuth)\n// ============================================================================\n\nmodel User {\n  id            String    @id @default(cuid())\n  name          String?\n  email         String    @unique\n  emailVerified DateTime?\n  image         String?\n\n  // Gamification fields\n  xp    Int @default(0)\n  level Int @default(1)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Auth.js relations (tracks login methods, not multiple user accounts)\n  accounts       Account[] // OAuth providers linked to this user (Google, GitHub, etc.)\n  sessions       Session[] // Active login sessions\n  authenticators Authenticator[] // WebAuthn/passkey credentials\n\n  // Budget app relations\n  categories   Category[]\n  transactions Transaction[]\n  budgets      Budget[]\n  goals        Goal[]\n  achievements UserAchievement[]\n  challenges   UserChallenge[]\n}\n\nmodel Account {\n  userId            String\n  type              String\n  provider          String\n  providerAccountId String\n  refresh_token     String?\n  access_token      String?\n  expires_at        Int?\n  token_type        String?\n  scope             String?\n  id_token          String?\n  session_state     String?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@id([provider, providerAccountId])\n}\n\nmodel Session {\n  sessionToken String   @unique\n  userId       String\n  expires      DateTime\n  user         User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel VerificationToken {\n  identifier String\n  token      String\n  expires    DateTime\n\n  @@id([identifier, token])\n}\n\nmodel Authenticator {\n  credentialID         String  @unique\n  userId               String\n  providerAccountId    String\n  credentialPublicKey  String\n  counter              Int\n  credentialDeviceType String\n  credentialBackedUp   Boolean\n  transports           String?\n\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@id([userId, credentialID])\n}\n\n// ============================================================================\n// BUDGETING\n// ============================================================================\n\n// Categories for organizing spending (Food, Gas, Entertainment, etc.)\nmodel Category {\n  id    String @id @default(cuid())\n  name  String\n  color String @default(\"#3B82F6\") // For visual display\n\n  userId String\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  createdAt DateTime @default(now())\n\n  transactions Transaction[]\n  budgets      Budget[]\n\n  @@unique([userId, name]) // Can't have duplicate category names\n}\n\n// Budget limits per category (e.g., $500/month for groceries)\nmodel Budget {\n  id     String @id @default(cuid())\n  amount Float // Budget limit\n  spent  Float  @default(0) // How much spent so far\n  month  String // Format: \"2025-03\" for March 2025\n\n  userId     String\n  user       User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n  categoryId String\n  category   Category @relation(fields: [categoryId], references: [id], onDelete: Cascade)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([userId, categoryId, month]) // One budget per category per month\n}\n\n// Individual expenses\nmodel Transaction {\n  id          String   @id @default(cuid())\n  amount      Float\n  description String\n  date        DateTime @default(now())\n\n  userId     String\n  user       User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n  categoryId String\n  category   Category @relation(fields: [categoryId], references: [id])\n\n  createdAt DateTime @default(now())\n}\n\n// Savings goals (e.g., \"Save $5000 for vacation\")\nmodel Goal {\n  id            String    @id @default(cuid())\n  name          String\n  targetAmount  Float\n  currentAmount Float     @default(0)\n  deadline      DateTime?\n  completed     Boolean   @default(false)\n\n  userId String\n  user   User   @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// ============================================================================\n// GAMIFICATION\n// ============================================================================\n\n// Master list of achievements (seed this with your achievements)\nmodel Achievement {\n  id          String @id @default(cuid())\n  name        String @unique\n  description String\n  xpReward    Int\n  icon        String @default(\"trophy\")\n\n  createdAt DateTime @default(now())\n\n  users UserAchievement[]\n}\n\n// Tracks which achievements each user earned\nmodel UserAchievement {\n  id String @id @default(cuid())\n\n  userId        String\n  user          User        @relation(fields: [userId], references: [id], onDelete: Cascade)\n  achievementId String\n  achievement   Achievement @relation(fields: [achievementId], references: [id], onDelete: Cascade)\n\n  earnedAt DateTime @default(now())\n\n  @@unique([userId, achievementId])\n}\n\n// Daily/weekly challenges\nmodel Challenge {\n  id          String   @id @default(cuid())\n  name        String\n  description String\n  type        String // \"daily\" or \"weekly\"\n  xpReward    Int\n  active      Boolean  @default(true)\n  startDate   DateTime\n  endDate     DateTime\n\n  createdAt DateTime @default(now())\n\n  users UserChallenge[]\n}\n\n// Tracks user progress on challenges\nmodel UserChallenge {\n  id        String  @id @default(cuid())\n  progress  Int     @default(0) // Progress toward challenge goal\n  completed Boolean @default(false)\n\n  userId      String\n  user        User      @relation(fields: [userId], references: [id], onDelete: Cascade)\n  challengeId String\n  challenge   Challenge @relation(fields: [challengeId], references: [id], onDelete: Cascade)\n\n  createdAt   DateTime  @default(now())\n  completedAt DateTime?\n\n  @@unique([userId, challengeId])\n}\n",
